use super::*;
use ckb_testtool::context::Context;
use ckb_tool::ckb_types::{bytes::Bytes, core::TransactionBuilder, packed::*, prelude::*};
use hex;

// const MAX_CYCLES: u64 = 10_000_000_000;
const MAX_CYCLES: u64 = u64::MAX;

#[test]
fn test_success() {
    // deploy contract
    let mut context = Context::default();
    let contract_bin: Bytes = Loader::default().load_binary("perf-analysis");
    let out_point = context.deploy_cell(contract_bin);

    // prepare scripts
    let lock_script = context
        .build_script(&out_point, Bytes::from(vec![42]))
        .expect("script");
    let lock_script_dep = CellDep::new_builder().out_point(out_point).build();

    // prepare cells
    let input_out_point = context.create_cell(
        CellOutput::new_builder()
            .capacity(1000u64.pack())
            .lock(lock_script.clone())
            .build(),
        Bytes::new(),
    );
    let input = CellInput::new_builder()
        .previous_output(input_out_point)
        .build();
    let outputs = vec![
        CellOutput::new_builder()
            .capacity(500u64.pack())
            .lock(lock_script.clone())
            .build(),
        CellOutput::new_builder()
            .capacity(500u64.pack())
            .lock(lock_script)
            .build(),
    ];

    let outputs_data = vec![Bytes::new(); 2];

    // 上面都是无关紧要的构造交易的代码可以忽略

    let witnesses = vec![
        Bytes::from(hex::decode("").unwrap()),
        // Bytes::from(hex::decode("64617300000000230000000c0000001f0000000f000000657874656e645f70726f706f73616c00000000").unwrap()),
        // Bytes::from(hex::decode("").unwrap()),
        // Bytes::from(hex::decode("").unwrap()),
        // Bytes::from(hex::decode("").unwrap()),
        // Bytes::from(hex::decode("").unwrap()),
        // Bytes::from(hex::decode("").unwrap()),
        // Bytes::from(hex::decode("").unwrap()),
        // Bytes::from(hex::decode("").unwrap()),
    ].pack();

    // build transaction
    let tx = TransactionBuilder::default()
        .input(input)
        .outputs(outputs)
        .outputs_data(outputs_data.pack())
        .cell_dep(lock_script_dep)
        .witnesses(witnesses)
        .build();
    let tx = context.complete_tx(tx);

    // run
    let cycles = context
        .verify_tx(&tx, MAX_CYCLES)
        .expect("pass verification");
    println!("consume cycles: {}", cycles);
}
